 @off7123  De fato, não é!
Um tem uma torcida gigante de âmbito nacional, que consegue gerar grandes receitas, empurrar o time para a sobrevivência mesmo em uma crise absurda de 2 décadas, e competir com todos os times na tabela. O outro tem uma torcida minúscula, que gera receitas ridículas, toma sufoco do pior elenco do campeonato com 2 expulsos em casa, toma 7 gols e um único jogo, é super pressionado e inferior a todos os adversários, tem um saldo de 18 gols negativos, e não teria forças pra aguentar a mesma crise que o primeiro passou!

De fato, Santos não é o Vasco!
